const GET_DMS_DOCUMENT_PENDING = 'GET_DMS_DOCUMENT_PENDING';
const GET_DMS_DOCUMENT_SUCCESS = 'GET_DMS_DOCUMENT_SUCCESS';
const GET_DMS_DOCUMENT_REJECTED = 'GET_DMS_DOCUMENT_REJECTED';

const GET_DMS_VERSION_HISTORY_PENDING = 'GET_DMS_VERSION_HISTORY_PENDING';
const GET_DMS_VERSION_HISTORY_SUCCESS = 'GET_DMS_VERSION_HISTORY_SUCCESS';
const GET_DMS_VERSION_HISTORY_REJECTED = 'GET_DMS_VERSION_HISTORY_REJECTED';

const RESET_DMS_UPLOAD_STATUS = 'RESET_DMS_UPLOAD_STATUS';

const UPDATE_DMS_UPLOAD_DOCUMENT_DTO = 'UPDATE_DMS_UPLOAD_DOCUMENT_DTO';

/* eslint import/no-anonymous-default-export: [2, {"allowObject": true}] */
export default {
  GET_DMS_DOCUMENT_PENDING,
  GET_DMS_DOCUMENT_SUCCESS,
  GET_DMS_DOCUMENT_REJECTED,
  GET_DMS_VERSION_HISTORY_PENDING,
  GET_DMS_VERSION_HISTORY_SUCCESS,
  GET_DMS_VERSION_HISTORY_REJECTED,
  RESET_DMS_UPLOAD_STATUS,
  UPDATE_DMS_UPLOAD_DOCUMENT_DTO,
};
